import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import ScoreLookup from './components/ScoreLookup';
import Reports from './components/Reports';
import Settings from './components/Settings';
import ScoreLevels from './components/ScoreLevels';
import TopStudents from './components/TopStudents';

const Sidebar = () => {
  const location = useLocation();
  return (
    <div style={{ width: '220px', background: 'linear-gradient(to bottom, #ffe259, #3a8dde)', color: '#222', padding: '30px 0 0 0', minHeight: '100%' }}>
      <div style={{ fontWeight: 'bold', fontSize: '1.3rem', marginBottom: '30px', textAlign: 'center' }}>Menu</div>
      <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
        <li style={{ padding: '12px 30px', cursor: 'pointer', fontWeight: location.pathname === '/' ? 'bold' : 'normal', background: location.pathname === '/' ? 'rgba(0,0,0,0.07)' : 'none' }}>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>Dashboard</Link>
        </li>
        <li style={{ padding: '12px 30px', cursor: 'pointer', fontWeight: location.pathname === '/search-scores' ? 'bold' : 'normal', background: location.pathname === '/search-scores' ? 'rgba(0,0,0,0.07)' : 'none' }}>
          <Link to="/search-scores" style={{ textDecoration: 'none', color: 'inherit' }}>Search Scores</Link>
        </li>
        <li style={{ padding: '12px 30px', cursor: 'pointer', fontWeight: location.pathname === '/score-levels' ? 'bold' : 'normal', background: location.pathname === '/score-levels' ? 'rgba(0,0,0,0.07)' : 'none' }}>
          <Link to="/score-levels" style={{ textDecoration: 'none', color: 'inherit' }}>Score Levels</Link>
        </li>
        <li style={{ padding: '12px 30px', cursor: 'pointer', fontWeight: location.pathname === '/top-students' ? 'bold' : 'normal', background: location.pathname === '/top-students' ? 'rgba(0,0,0,0.07)' : 'none' }}>
          <Link to="/top-students" style={{ textDecoration: 'none', color: 'inherit' }}>Top 10 Students</Link>
        </li>
        <li style={{ padding: '12px 30px', cursor: 'pointer', fontWeight: location.pathname === '/reports' ? 'bold' : 'normal', background: location.pathname === '/reports' ? 'rgba(0,0,0,0.07)' : 'none' }}>
          <Link to="/reports" style={{ textDecoration: 'none', color: 'inherit' }}>Reports</Link>
        </li>
        <li style={{ padding: '12px 30px', cursor: 'pointer', fontWeight: location.pathname === '/settings' ? 'bold' : 'normal', background: location.pathname === '/settings' ? 'rgba(0,0,0,0.07)' : 'none' }}>
          <Link to="/settings" style={{ textDecoration: 'none', color: 'inherit' }}>Settings</Link>
        </li>
      </ul>
    </div>
  );
};

function App() {
  return (
    <Router>
      <div style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
        {/* Header */}
        <div style={{ background: '#1428a0', color: 'white', padding: '20px 0', textAlign: 'center', fontSize: '2rem', fontWeight: 'bold' }}>
          G-Scores
        </div>
        <div style={{ display: 'flex', flex: 1 }}>
          {/* Sidebar */}
          <Sidebar />
          {/* Main Content */}
          <div style={{ flex: 1, background: '#f7f8fa', padding: '40px 30px', overflowY: 'auto' }}>
            <Routes>
              <Route path="/" element={<Dashboard />} />
              <Route path="/search-scores" element={<ScoreLookup />} />
              <Route path="/score-levels" element={<ScoreLevels />} />
              <Route path="/top-students" element={<TopStudents />} />
              <Route path="/reports" element={<Reports />} />
              <Route path="/settings" element={<Settings />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
